	<div class="wpb_column vc_column_container vc_col-sm-6 "><div class="vc_column-inner " >
		<div class="wpb_wrapper">
			<div class="wbc-heading clearfix"><h2 class="special-heading-3" style="font-size:40px;color:#ffffff;margin-left:50px;">Become A <span class="wbc-color" style="color:#edcd00;">FULLTIME</span> DJ</h2></div>
	<div class="wpb_text_column wpb_content_element  vc_custom_1515946981959" >
		<div class="wpb_wrapper">
			<p><span style="color: #808080;">SpinStatz was created to help DJs do what they love on a fulltime basis. With our platform verified club DJs, internet radio DJs, and live event DJs are now capable of earning up to $2,000 per night simply playing music. There is no sign up fee and there are no gimmicks. To begin using our services DJs must request a special invite email. </span></p>

		</div>
	</div>
<div class="wbc-heading clearfix"><h2 class="special-heading-3" style="font-size:40px;color:#ffffff;margin-left:50px;">How <span class="wbc-color" style="color:#edcd00;">DJs Earn</span> Money?</h2></div>
	<div class="wpb_text_column wpb_content_element  vc_custom_1515902600194" >
		<div class="wpb_wrapper">
			<p><span style="color: #808080;">Most club DJs get paid to host parties and live events. Using SpinStatz revolutionary system DJs can earn additional income simply playing music downloaded from our system.</span><br />
<span style="color: #808080;">•Browse through different music campaigns within DJ specified music genres.</span><br />
<span style="color: #808080;">•Each music campaign displays an amount that will automatically be added to the DJs personal wallet every time the song is played.</span><br />
<span style="color: #808080;">•DJs Can download the songs from as many of these music campaigns as desired.</span><br />
<span style="color: #808080;">•Withdraw funds at any time.</span></p>

		</div>
	</div>
<div class="wbc-heading clearfix"><h2 class="special-heading-3" style="font-size:40px;color:#ffffff;margin-left:50px;">Get Invited</h2></div>
	<div class="wpb_text_column wpb_content_element  vc_custom_1515902361007" >
		<div class="wpb_wrapper">
			<p><span style="color: #808080;">Once a DJ passes our extensive verification process he or she will receive their account credentials that will allow them to begin earning money. Every DJ account gives DJs a personal dashboard that displays all of their activity. Colorful graphs and charts show each DJ exactly which songs and what time they played each song.</span></p>

		</div>
	</div>
<div class="wbc-heading clearfix"><h2 class="special-heading-3" style="font-size:40px;color:#ffffff;margin-left:50px;">DJ <span class="wbc-color" style="color:#edcd00;">COALITIONS</span> Are Welcome</h2></div>
	<div class="wpb_text_column wpb_content_element  vc_custom_1515911088710" >
		<div class="wpb_wrapper">
			<p><span style="color: #808080;">SpinStatz has DJs and DJ coalitions from all over the world. One major issue many DJ coalition owners faced was getting the cooperation of all their DJs. This was a HUGE problem for many owners considering funds had been received with the understanding that the coalition&#8217;s DJs would play the music in clubs. This problem has been solved. Using the SpinStatz platform Coalition managers now have more control over their DJs than ever before. Coalition owners can now monitor each of their DS&#8217;s activity. See detailed information such as the time specific songs were played and which songs are most popular within their organization. </span><span style="color: #808080;">If your DJ Organization has not signed up for our service contact our support department and request a special coalition invitation email.</span><span style="color: #808080;"> </span></p>

		</div>
	</div>
